import React, { Component } from "react";
import User from "../components/User";
import UserConsumer from "../context";

class Users extends Component {
  render() {
    return (
      <UserConsumer>
        {(value) => {
          return (
            <div>
              {value.users.map((user) => {
                return (
                  <User
                    key={user.id}
                    name={user.name}
                    jobTitle={user.jobTitle}
                    salary={user.salary}
                  />
                );
              })}
            </div>
          );
        }}
      </UserConsumer>
    );
  }
}
export default Users;
